    return(
      <div className="white profile-wrapper">
        <div className="row">
          <div className="col l12 m12 s12">
            <div className="dp-and-about row">

              <div className="col l4 m4 s12">
                <profilePicture />
              </div>

              div.col.l8.m8.12

            </div>
          </div>
        </div>
      </div>
    )
  }
}

